// import { useState, useEffect } from "react";
import React from 'react';
import GetData from '../service/logementService';
import "../styles/Accueil.css";
import Banner from '../components/Banner';
import { useNavigate } from "react-router-dom";

function Accueil(props) {
  const resultFetch = GetData("/db/logements.json");
  const locations = resultFetch.data;
  const loading = resultFetch.loading;

  let navigate = useNavigate()
  const userIdUrl = (userId) => {
    navigate("./logement/" + userId)
    const filtreLocation = locations.find((location) => location.id === userId);
    // console.log(filtreLocation);
  };

  if(loading){
    return <h1>LOADING ...</h1>
  }
  return (
    <section>
      <div>
        <Banner />
      </div>
        {/* <p>{props.data}</p> */}
        <div className="logements_container">
          <article className="logements_card">
           {locations.map((location, index) => (
                <div onClick={() => userIdUrl(location.id)} className="logement_et_titre" key={index}>
                  <p>{location.title}</p>
                  <img className="accueil_img" src={location.cover} alt="logements"/>
                </div>
            ))}
          </article>
        </div> 
    </section>
  );
}
export default Accueil;
